Objectif : Apprendre à ajouter des commentaires Doxygen/Javadoc essentiels aux méthodes de votre classe StringUtils et générer une première documentation. Commentez les méthodes de StringUtils.java : Ouvrez votre fichier src/main/java/com/formation/stringutils/StringUtils.java et ajoutez ou complétez les commentaires Javadoc pour chaque méthode (renverser, estPalindrome, compterVoyelles). // Fichier : src/main/java/com/formation/stringutils/StringUtils.java
package com.formation.stringutils; public class StringUtils { /** * @brief Renverse une chaîne de caractères. * Cette méthode prend une chaîne en entrée et retourne sa version inversée. * Si la chaîne d'entrée est null, la méthode retourne null. * * @param chaine La chaîne de caractères à renverser. * @return La chaîne renversée, ou null si la chaîne d'entrée est null. */ public String renverser(String chaine) { if (chaine == null) return null; return new StringBuilder(chaine).reverse().toString(); } /** * @brief Vérifie si une chaîne est un palindrome. * Un palindrome est un mot ou une phrase qui se lit de la même manière dans les deux sens. * Cette méthode ignore la casse et les espaces lors de la vérification. * * @param chaine La chaîne à vérifier. * @return true si la chaîne est un palindrome (en ignorant casse et espaces), false sinon. Retourne false pour une chaîne null. */ public boolean estPalindrome(String chaine) { if (chaine == null) return false; String chaineNettoyee = chaine.replaceAll("\\s+", "").toLowerCase(); String chaineRenversee = new StringBuilder(chaineNettoyee).reverse().toString(); return chaineNettoyee.equals(chaineRenversee); } /** * @brief Compte le nombre de voyelles dans une chaîne. * Les voyelles prises en compte sont 'a', 'e', 'i', 'o', 'u', insensibles à la casse. * * @param chaine La chaîne dans laquelle compter les voyelles. * @return Le nombre total de voyelles trouvées dans la chaîne. Retourne 0 si la chaîne est null ou vide. */ public int compterVoyelles(String chaine) { if (chaine == null || chaine.isEmpty()) { return 0; } int count = 0; String voyelles = "aeiouAEIOU"; for (char c : chaine.toCharArray()) { if (voyelles.indexOf(c) != -1) { count++; } } return count; }
} Explication des balises Doxygen/Javadoc utilisées : @brief <description> : Fournit une description courte et concise de l'élément (ici, une méthode). Apparaît souvent en résumé. @param <nom_param> <description> : Décrit un paramètre spécifique de la méthode, en précisant son nom et son rôle. @return <description> : Explique ce que la méthode retourne. @throws <TypeException> <description> (ou @exception) : Documente les exceptions qu'une méthode est susceptible de lever et dans quelles circonstances (non utilisé dans cet exemple simple de StringUtils, mais bon à savoir). Génération du fichier de configuration Doxyfile : Dans votre terminal, naviguez à la racine de votre projet maStringUtilsApp. Exécutez la commande : doxygen -g Cela crée un fichier de configuration nommé Doxyfile. Vous pouvez également lancer la commande : doxygen -g NomDeVotreDoxyfile pour créer un fichier de configuration avec un nom que vous choisissez. Si le fichier Doxyfile ou NomDeVotreDoxyfile existe déjà, Doxygen le renommera en ajoutant .bak avant d'en créer un nouveau. Configuration du Doxyfile : Ouvrez le fichier Doxyfile avec un éditeur de texte et modifiez (ou décommentez et modifiez) les options suivantes : PROJECT_NAME = "Documentation du Projet maStringUtilsApp" Rôle : Définit le titre principal de votre documentation générée. OUTPUT_DIRECTORY = docs_stringutils Rôle : Spécifie le nom du répertoire où Doxygen placera les fichiers de documentation générés. INPUT = ./src/main/java Rôle : Indique à Doxygen le(s) dossier(s) ou fichier(s) contenant le code source à analyser. Ici, on pointe vers la racine des sources Java de Maven. RECURSIVE = YES Rôle : Si mis à YES, Doxygen explorera les sous-dossiers des chemins spécifiés dans INPUT. Essentiel pour les projets Java structurés en packages. FILE_PATTERNS = *.java Rôle : Permet de filtrer les types de fichiers à analyser. Ici, on se concentre sur les fichiers Java. OPTIMIZE_OUTPUT_JAVA = YES Rôle : Active des optimisations et des analyses spécifiques au langage Java, ce qui peut améliorer la pertinence et la présentation de la documentation pour les projets Java. JAVADOC_AUTOBRIEF = YES Rôle : Si YES, Doxygen considérera automatiquement la première phrase d'un commentaire Javadoc (avant le premier point suivi d'un espace, ou avant une ligne vide) comme une description brève (@brief), même si la balise @brief n'est pas explicitement présente. EXTRACT_ALL = NO Rôle : Si NO, Doxygen ne documentera que les éléments de code qui possèdent des commentaires Doxygen/Javadoc. NO est généralement préférable pour une documentation d'API ciblée. EXTRACT_PRIVATE = NO Rôle : Si NO, les membres privés des classes ne seront pas inclus dans la documentation. EXTRACT_STATIC = YES Rôle : Assure que les membres statiques sont inclus dans la documentation (important pour notre classe StringUtils si ses méthodes sont statiques, sinon adaptez). Génération de la documentation : Toujours dans votre terminal, à la racine du projet, exécutez : doxygen Si vous avez utilisé un nom personnalisé pour votre Doxyfile, lancez : doxygen NomDeVotreDoxyfile Consultation de la documentation : Ouvrez le fichier docs_stringutils/html/index.html (ou le chemin que vous avez défini dans OUTPUT_DIRECTORY) dans un navigateur web. Explorez la documentation : vous devriez trouver votre classe StringUtils et voir comment vos commentaires ont été transformés en une documentation structurée pour chaque méthode.
